package pac;

public class JumpGameVII {
	static  int[] dp;
	public static void method() {
		String s="";
System.out.println(s.length());
				boolean res=canReach(s, 1, 99999);
		System.out.println(res);
	}
	    public static boolean canReach(String s, int minJump, int maxJump) {
	        dp=new int[s.length()];
	        if(s.charAt(s.length()-1)=='0')
	        dp[s.length()-1]=2;
	        else
	         dp[s.length()-1]=1;

	        return fun(0,s,minJump,maxJump);

	        
	    }
	    private static boolean fun(int index,String s,int min,int max){
	        if(dp[index]==1)
	        return false;
	        else if(dp[index]==2)
	        return true;
	        boolean res=false;
	        if(s.charAt(index)=='1'){
	            dp[index]=1;
	            return false;

	        }
	        
	        
	        int start=index+min;
	        int end=Math.min(index+max,s.length()-1);
	        if(start>=s.length()){ 
	            dp[index]=1;
	             return false;

	        }
	      
	        for(int i=start;i<=end;i++){
	            if(dp[i]==1)
	            return false;
	            else if(dp[i]==2)
	            return true;
	            boolean val=fun(i,s,min,max);
	            if(val==true){
	                dp[index]=2;
	                return true;

	            }
	            

	        }
	        dp[index]=1;
	        return false;

	    }

}
